import React from 'react';
import Container from '../../common/Container/Container';
import image1 from '../../asets/gallery/gallery-1.jpg';
import image2 from '../../asets/gallery/gallery-2.webp';
import image3 from '../../asets/gallery/gallery-3.jpg';
import image4 from '../../asets/gallery/gallery-4.jpg';
import './Galllery.scss';

const Gallery = () => {
  const images = [image1, image2, image3, image4];

  const renderImages = images.map((item, index) => (
    <img className="gallery__image" src={item} key={index} alt="gallery" />
  ));
  return <Container customClass="gallery">{renderImages}</Container>;
};

export default Gallery;
